import Imagem from "../../components/Imagem"
import logo from "../../assets/logo.png"
import { Step, StepLabel, Stepper } from "@mui/material"
import styled from "styled-components"
import { useState } from "react"
import { Formulario, TituloCadastro } from "./styles"
import CompoDigitacao from "../../components/CampoDigitacao"
import Button from "../../components/Button"
import axios from 'axios'

interface PropsCustomizadas{
    cor: string,
}

const StepCustomizada = styled.div<PropsCustomizadas>`
background-color: ${({cor}) => cor}; 
width: 16px;
height: 16px;
border-radius: 50px;
`

const Container = styled.div`
  display: grid;
  width: 100%;
  grid-template-columns: 30% 70%;
  justify-content: space-between
`;

export default function Cadastro(){

    const [etapaAtiva, setEtapaAtiva] = useState(0)

    const handleSubmit = (event: React.FormEvent<HTMLFormElement>) => {
        event.preventDefault();
        setEtapaAtiva(etapaAtiva + 1);
    }

    const [nome, setNome] = useState('')
    const [cnpj, setCnpj] = useState('')
    const [email, setEmail] = useState('')
    const [senha, setSenha] = useState('')
    const [senhaVerificada, setSenhaVerificada] = useState('')
    const [telefone, setTelefone] = useState('')
    const [cep, setCep] = useState('')
    const [rua, setRua] = useState('')
    const [bairro, setBairro] = useState('')
    const [cidade, setCidade] = useState('')

    const buscarCep = async (cepDigitado: string) => {
        if (cepDigitado.length === 8) {
            try {
                const res = await axios.get(`https://viacep.com.br/ws/${cepDigitado}/json/`);
                console.log(res.data); // Aqui você recebe os dados do CEP
                // Atualize os outros campos do formulário aqui
                const dados = res.data
                setRua(dados.logradouro)
                setBairro(dados.bairro)
                setCidade(dados.cidade)
            } catch (error) {
                console.error('Erro ao buscar CEP', error);
            }
        }
    };


    return (
        <>
        <Imagem src={logo} alt="logo da voll"/>
        <Stepper activeStep={etapaAtiva}>
            <Step>
                <StepLabel
                        StepIconComponent={(props) => (
                            <StepCustomizada cor={props.active ? 'lightblue' : 'lightgray'} />
                        )}
                    />
            </Step>
            <Step>
            <StepLabel
                StepIconComponent={(props) => (
                    <StepCustomizada cor={props.active ? 'lightblue' : 'lightgray'} />
                )}/>
            </Step>
        </Stepper>

        {etapaAtiva === 0 ? (
            <>
            <TituloCadastro>Primeiro, alguns dados básicos</TituloCadastro>
            <Formulario onSubmit={handleSubmit}>
                <CompoDigitacao 
                valor={nome}
                tipo='text'
                placeholder="Digite o nome da clínica"
                onChange={setNome}
                label='Nome'/>

                <CompoDigitacao 
                valor={cnpj}
                tipo='text'
                placeholder="Digite o CNPJ"
                onChange={setCnpj}
                label='CNPJ'/>

                <CompoDigitacao 
                valor={email}
                tipo='email'
                placeholder="Digite o endereço de email para login"
                onChange={setEmail}
                label='Email'/>

                <CompoDigitacao 
                valor={senha}
                tipo='password'
                placeholder="Digite sua senha"
                onChange={setSenha}
                label='Crie uma senha'/>


                <CompoDigitacao 
                valor={senhaVerificada}
                tipo='password'
                placeholder="Digite sua senha novamente"
                onChange={setSenhaVerificada}
                label='Confirme sua senha'/>

                <Button texto='Avançar'/>
            </Formulario>
            </>
        ):(
            <>
            <Formulario>
            <TituloCadastro>Agora, alguns dado técnicos:</TituloCadastro>
            <CompoDigitacao 
                valor={telefone}
                tipo='tel'
                placeholder="(XX) X XXXX-XXXX"
                onChange={setTelefone}
                label='Telefone'/>

            <CompoDigitacao 
                valor={cep}
                tipo='number'
                placeholder="Insira o seu CEP"
                onChange={(e) => {
                    setCep(e);
                    buscarCep(e);
                }}
                label='CEP'/>

            <CompoDigitacao 
                valor={rua}
                tipo='text'
                placeholder="Rua"
                onChange={setRua}
                label='Endereço'/>

            <Container>
                <CompoDigitacao
                valor={bairro}
                tipo='text'
                placeholder="Bairro"
                onChange={setBairro}
                label='Bairro'
                />

                 <CompoDigitacao
                valor={cidade}
                tipo='text'
                placeholder="Cidade"
                onChange={setCidade}
                label='Cidade'
                />
            </Container>
            </Formulario>


            </>


        )
        }
        </>
    )
}

export {}
